INSERT INTO `adminnotification_inbox` VALUES ('1',1,'2016-05-18 02:43:59','Community Edition 2.0.6 Provides Important Security and Functional Updates – 5/18/2016','Magento Community Edition 2.0.6 is now available and contains important security and functional improvements. More information on the security updates can be found on the Magento Security Center at https://magento.com/security/patches/magento-206-security-update. More information on the functional enhancements is provided in the release notes: http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.6CE.html','https://magento.com/security/patches/magento-206-security-update',0,0),('2',4,'2016-05-22 04:41:58','Repo.magento.com is currently unavailable. We are working to resolve this issue as quickly as possible – 5/22/16, 11:40 am PT','Users currently cannot access Magento 2 code updates from Repo.magento.com. We are investigating the issue and will update you when it is resolved. As an alternative, you can still access Magento 2 code from GitHub (https://github.com/magento/magento2) or from the Community Edition download page (https://www.magentocommerce.com/download). ','https://github.com/magento/magento2',0,0),('3',4,'2016-05-22 09:12:08','Issue with repo.magento.com has been resolved - 5/22/16, 4 pm PT','The issue with repo.magento.com has been resolved. You should be able to access Magento 2 code updates at this time.','http://devdocs.magento.com/guides/v2.0/install-gde/prereq/integrator_install.html',0,0),('4',4,'2016-05-24 00:08:30','New release: Magento Community Edition 2.0.7 Resolves Payment Gateway Issues – 5/24/16 ','Magento Community Edition 2.0.7 is now available. It resolves payment gateway issues experienced when using PHP 7.0.3. Review the release notes for more information: http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.7CE.html.','http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.7CE.html',0,0),('5',4,'2016-06-06 07:44:09','New Community Edition 2.0.7 Patch (MDVA-449) for Merchants Using PHP 5.5.x – June 6, 2016 ','A new patch, MDVA-449, enables merchants using Community Edition 2.0.7 and PHP 5.5.x to upgrade to future releases. It corrects a line of code in the Setup application that is packaged with Community Edition 2.0.7 that is not compatible with PHP 5.5.x. Merchants using Community Edition 2.0.7 with PHP 5.6.x and 7.0.x DO NOT need this patch. Learn more at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_207-upgrade.html ','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_207-upgrade.html ',0,0),('6',4,'2016-06-22 08:29:31','New Community Edition 2.0.x Patch (MDVA-532) Enables Upgrades to Magento 2.1 – June 22, 2016','A new patch, MDVA-532, enables merchants using Magento Community Edition 2.0.x to upgrade to Magento 2.1 Community Edition Release Candidates or GA software. More information about the patch and important instructions for command-line upgrades to Magento 2.1 when sample data is installed are available in a technical bulletin posted at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_21-upgrade.html.','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_21-upgrade.html',0,0),('7',4,'2016-06-23 02:44:46','Increase your sales and productivity, while simplifying PCI compliance with exciting new Magento Community Edition 2.1 features.','Shoppers can now check out faster using credit cards stored with PayPal and a redesigned PayPal checkout. PCI compliance is easier thanks to Braintree Hosted Fields. Admin tools are redesigned to help you work more efficiently. Upgrade to Enterprise Edition for new Content Staging and Preview and Enhanced Site Search capabilities.','https://magento.com/blog/magento-news/magento-enterprise-edition-21-unleashes-power-marketers-and-merchandisers ',0,0),('8',4,'2016-07-22 11:56:40','Community Edition 2.0.8 improves installation, configurable product creation and more – 7/19/2016','Magento Community Edition 2.0.8 makes several functional improvements that address issues with application installation, duplication of url keys during configurable product creation, and other issues described in the release notes posted at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.8CE.html.','http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.8CE.html',0,0),('9',4,'2016-01-13 22:52:11','Have questions? Magento has big answers at Imagine Commerce.','Big news, bigger experts, and an even bigger ecosystem. Will you be at Imagine Commerce? Join us. ','http://imagine.magento.com',0,0),('10',1,'2016-01-20 22:17:09','Important: Install Magento Community Edition 2.0.1 for Security & Functional Updates – 1/20/2016','Today, we are releasing Magento Community Edition 2.0.1 to improve the security and functionality of Magento 2.0 sites. There are no confirmed attacks related to the security issues, but certain vulnerabilities can potentially be exploited to access customer information or take over administrator sessions. Community Edition 2.0.1 also includes USPS API updates and support for PHP7.0.2, which enables dramatic performance improvements and other benefits. You can download the release from the Community Edition Download Page or by using Composer. Learn more at https://magento.com/security/patches/magento-201-security-update. \n','https://magento.com/security/patches/magento-201-security-update',0,0),('11',1,'2016-01-29 00:08:45','Important: Magento Community Edition 2.0.2 Addresses Upgrade Issues – January 28, 2016','Newly released Magento Community Edition 2.0.2 resolves issues encountered by some users when upgrading Magento Community Edition 2.0.0 and 2.0.1. The issues occur with products that were installed from a compressed archive (.tar.gz, .zip, and .bz2); merchants who used other installation options are not affected. More information is available in the Technical Bulletin at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_201-upgrade.html. ','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_201-upgrade.html',0,0),('12',1,'2016-03-31 00:24:35','Magento Community Edition 2.0.3 Includes Functional and Security Updates – 3/30/2016','Magento Community Edition 2.0.3 is now available and contains important security updates, as well as performance improvements and functional enhancements. Full details on the functional enhancements are included in the release notes at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.3CE.html. More information on the security updates can be found on the Magento Security Center at https://magento.com/security/patches/magento-203-security-update.','https://magento.com/security/patches/magento-203-security-update',0,0),('13',1,'2016-04-01 06:40:23','New Release: Magento Community Edition 2.0.4 – 3/31/2016','We have released Magento Community Edition 2.0.4 to address a packaging issue with yesterday’s release. If you have already installed Enterprise Edition 2.0.3, you must replace it with the new version to ensure that your site receives all security enhancements. Learn more at https://magento.com/security/patches/magento-204-security-update','https://magento.com/security/patches/magento-204-security-update',0,0),('14',4,'2016-08-10 22:27:44','Community Edition 2.0.9 Improves Performance and Product Quality ','Community Edition 2.0.9 is now available and improves storefront performance when a large number of configurable product variations are used and resolves issues with price and tax calculations, mini-cart displays and more. You can learn more in the release notes at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.9CE.html ','http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.9CE.html',0,0),('15',4,'2016-08-30 16:36:54','Community Edition 2.1.1 Features Performance and Functional Improvements – 8/30/2016','Community Edition 2.1.1 improves storefront performance when using many configurable product variations and addresses upgrade and installation issues. You can learn more in the release notes at http://devdocs.magento.com/guides/v2.1/release-notes/ReleaseNotes2.1.1CE.html.','http://devdocs.magento.com/guides/v2.1/release-notes/ReleaseNotes2.1.1CE.html ',0,0),('16',4,'2016-09-12 22:50:17','Which Marketplaces/Social Media Platforms Matter Most? Take Our Brief Survey.','Here at Magento we are continuously looking to improve our product. \n\nWe want to know which marketplaces and social media platforms you use to advertise and sell products from your Magento store. This simple survey should take less than five minutes. Your feedback is essential and we will keep your response completely confidential.\n \nTake the survey:  https://www.research.net/r/5BZCC2Q\n','https://www.research.net/r/5BZCC2Q',0,0);
